$(function() {
	$("ul").find("li:first-child").addClass("first");
	$("ul").find("li:last-child").addClass("last");
	var maxHeight = 0;
	function setHeight(column) {
		//Get all the element with class = col
		column = $(column);
		//Loop all the column
		column.each(function() {       
			//Store the highest value
			if($(this).height() > maxHeight) {
				maxHeight = $(this).height();;
			}
		});
		//Set the height
		column.height(maxHeight);
	}
	setHeight('.colautoheight');
	//set auto width or height for img
	var tn_img_ratio=$(".tn_img_ratio-auto").width() / $(".tn_img_ratio-auto").height();
	var tn_dv_ratio=$(".tn_dv_ratio-auto").width() / $(".tn_dv_ratio-auto").height();
	if(tn_img_ratio>=tn_dv_ratio){
		$(".tn_img_ratio-auto").css('height','100%').css('width','auto');
	}else{
		$(".tn_img_ratio-auto").css('width','100%').css('height','auto');
	}
	var width_ul = 0;
	$('.wrapMainNav > li').each(function(){ width_ul+= $(this).width(); });
	$('.wrapMainNav').css("width",width_ul);
	
	$('.tnjs-tooltip').tooltip();
	
	$('.tn-cus-scroll').mCustomScrollbar({theme:"light-3"});
	
	/*
	$('#nhataitro').carouFredSel({
		responsive: true,
		width: '100%',
		scroll: 2,
		items: {
			width: 100,
		//	height: '30%',	//	optionally resize item-height
			visible: {
				min: 2,
				max: 8
			}
		}
	});
	*/
	
	$( "#chatbox-remove" ).bind( "click", function() {
		$('#chatbox-bot').hide();
	});
	$( "#chatbox-mini" ).bind( "click", function() {
		$(this).toggleClass('minibox');
		$('#chatbox-bot').toggleClass('minibox');
	});
	
	$('input.tn-datepicker').Zebra_DatePicker();
	
	
	/*$('.tn-hometds > a.hometds-capkeo').delay(1000).queue(function(){
		$('.tn-hometds > a.hometds-capkeo').toggleClass('active');
		$(this).dequeue();
	});*/
	
	/*$('.hometds-capkeo').addClass('active').stop().delay(1000).queue(function(){
		$(this).removeClass('active');
	});*/
	
	var $mouth0 = $(".tn-hometds");
	var $mouth1 = $(".hometds-capkeo");
	var $mouth2 = $(".hometds-facebook");
	var $mouth3 = $(".hometds-datsan");
	var $mouth4 = $(".hometds-thethao");
	var $mouth5 = $(".hometds-giaidau");
    (function toggleMouth(){       	
	
		var ndelay = 3000;
		
		if($mouth0.hasClass('active')){
			//alert(111111111);
			$mouth1.addClass("active").delay(ndelay).queue(function(){
				$mouth1.removeClass("active").dequeue();
				$mouth2.addClass("active").delay(ndelay).queue(function(){
					$mouth2.removeClass("active").dequeue();
					$mouth3.addClass("active").delay(ndelay).queue(function(){
						$mouth3.removeClass("active").dequeue();
						$mouth4.addClass("active").delay(ndelay).queue(function(){
							$mouth4.removeClass("active").dequeue();
							$mouth5.addClass("active").delay(ndelay).queue(function(){
								$mouth5.removeClass("active").dequeue();
							});	
						});	
					});	
					
				});	
			});
			$mouth0.removeClass('active')
		}
	
        setTimeout(function(){			
			$mouth1.addClass("active").delay(ndelay).queue(function(){
				$mouth1.removeClass("active").dequeue();
				$mouth2.addClass("active").delay(ndelay).queue(function(){
					$mouth2.removeClass("active").dequeue();
					$mouth3.addClass("active").delay(ndelay).queue(function(){
						$mouth3.removeClass("active").dequeue();
						$mouth4.addClass("active").delay(ndelay).queue(function(){
							$mouth4.removeClass("active").dequeue();
							$mouth5.addClass("active").delay(ndelay).queue(function(){
								$mouth5.removeClass("active").dequeue();
							});	
						});	
					});	
					
				});	
			});		
			
            toggleMouth();
			
        },15*1000);
		
		
    })();	
	
});


